import React, { Component } from 'react';

import 'bootstrap/dist/css/bootstrap.min.css';
import { Input } from 'reactstrap';
import './DynamicSelect.css';

class DynamicSelect extends Component {
    handleChange = (event) => {
        let selectedValue = event.target.value;
        this.props.onSelectChange(selectedValue);
    }

    render() {
        let workedHourInMonth = this.props.workedHourInMonth;
        let monthName = this.props.monthName;
        let x = {
            ...workedHourInMonth,
            ...monthName
        }
        console.log(x);
        let options = monthName.map((data, index) =>
            <option
                key={index}
                value={index}
            >
                {data}
            </option>
        );

        return (
            <div>                
                <Input className="select" onChange={this.handleChange} type="select" name="monthName">
                    {options}
                </Input>
            </div>
        )
    }
}

export default DynamicSelect;
